import React from 'react'
import '../index.css'
export default function Home (){

  const handleGmailClick = () => {
    window.location.href = "mailto:takhleesfatima2003@gmail.com";
  
}

const handleLinkedInClick = () => {
    window.open("https://www.linkedin.com/in/takhlees-fatima-668410235/");
  
}

const handleGitHubClick = () => {
    window.open("https://github.com/Takhlees");
  
}
    return (
        
    <div id="home">
    <div id="heading">
      <h3>Hey, I am </h3>
      <h2>Takhlees Fatima</h2>
    </div>
    <div id="paragraph">
    <div className="gmail">
        <img src={Gmail}></img>
       <p>Gmail</p>
      <span onClick={handleGmailClick}>takhleesfatima2003@gmail.com</span>
      </div>

      <div className="linkedin">
      <img src={LinkedIn}></img>
      <p>LinkedIn</p>
      <span onClick={handleLinkedInClick}>Takhlees Fatima</span>
      </div>

      <div className="github">
      <img src={GitHub}></img>
      <p>GitHub</p>
      <span onClick={handleGitHubClick}>Takhlees Fatima</span>
       </div>
    </div>
 </div>
    )
}
